 <div id=u39_text class=text>
 <p style=text-align:left><span>1.台号设置为第一必填项；未输入台号无法进行查询,同时弹出提醒：</span><span style=text-decoration:underline>请先输入台号，方可进行作业（提醒保留三秒，恢复原作业页面）</span><p style=text-align:left><span>2.台号支持扫码输入与手动输入，同一个作业台PC端扫描一次后，可以一直保留，直至清除该查询项内容或重新扫描其他台号条形码</span><p style=text-align:left><span>3.台号查询项，扫描后默认展示对应的质检台号</span><p style=text-align:left><span>4.台号输入后，读取【质检台管理】的监控强制开启功能的使用情况</span><ul><li style=text-align:left><span>如果功能为开启，则在质检</span><span style=color:#D9001B>扫描物流单号</span><span>或</span><span style=color:#D9001B>商品条码</span><span>时，会实时校验对应监控是否有开启（根据扫码枪触发校验监控开启情况）；如果监控未开启则无查询结果，也无法进行验收（参考需求内容3），监控为开启，则正常作业</span><li style=text-align:left><span>未开启，则无监控状态的查询；即监控未开启也可进行验收</span></ul><p style=text-align:left><span>5.台号输入错误，弹出提醒：台号错误，请重新输入</span><p style=text-align:center><span style=text-decoration:underline><br></span></p>
